function map(){
    var ary=[22,45,67,2];
    var b=ary.map(test);
    document.write(b);
    function test(x){
        return x*10;
    }
}
function map2(){
    var ary=[
        {fname:"Hilal", lname: "Ahmad"},
        {fname:"Jalal", lname: "Nasir"},
        {fname:"Bilal", lname: "Ahmad"},
        {fname:"Suliman", lname: "Ahmad"},
        {fname:"jamal", lname: "nasir"}
];
    var b=ary.map(test);
    document.write(b);
    function test(x){
        return x.fname+" "+x.lname;
    }
}
export default map;
export {map2};
